import React, { Component } from 'react';

export class Table extends Component {

  render() {
    return(
      <div id="form">
      <h1>Table Component</h1>
      <form>
          <input type="text" name="developer" placeholder='developer'/>
          <input type="text" name="skill" placeholder='skill'/>
      </form>
    </div>
    )
  }

}
